import React from 'react'

class NewWorkout extends React.Component {
    state = {
        exercises: [],
        addedExercises: []
    }

    getData = () => {
        fetch("/api/exercise")
            .then(res => res.json())
            .then(exercises => this.setState({exercises}))
    }


    componentDidMount = () => {
        this.getData();
    }

    addToWorkout = event => {
        console.log(event);
    }

    render() {
        return (
            <div>
                <h1>New workout page</h1>
                <form>
                    <input type="text" placeholder="Search" />
                </form>
                <div>
                    {
                        this.state.exercises.map(item => {
                            return <form><input type="checkbox" name="exercise" value={item.name} /></form>
                        })
                    }
                </div>
            </div>
        )
    }
}

export default NewWorkout
